    n, m = map(int, stdin.split())
    edges = [[] for i in range(n)]
    dist = [0]*n

    for i in range(m):
        u, v, w = map(int, stdin.split())
        edges[u-1].append((v-1, w))
        edges[v-1].append((u-1, w))
        dist[u-1] += w
        dist[v-1] += w

    unvisited = set(range(n))

    def Dijkstra(start):
        visited = set()
        curr_dist = dist[start]
        unvisited.remove(start)
        visited.add(start)
        while unvisited:
            min_dist = float('inf')
            for node in unvisited:
                if dist[node] < min_dist:
                    min_dist = dist[node]
                    min_node = node
            unvisited.remove(min_node)
            for adj_node, adj_dist in edges[min_node]:
                if adj_node in unvisited and dist[min_node] + adj_dist < dist[adj_node]:
                    dist[adj_node] = dist[min_node] + adj_dist
            visited.add(min_node)
        return curr_dist

    max_dist = 0
    for start in range(n):
        max_dist = max(max_dist, Dijkstra(start))
    return str(max_dist)

