        for i in groups[e]:
            if i - 1 in groups[e] or i + 1 in groups[e]:
                unadjacent[i].append(e)
                break

    # events which are not in adjacent groups
    nonadjacent = {i: [] for i in groups}
    for e in groups:
        if e not in unadjacent:
            nonadjacent[e] = groups[e]

    # count the number of good itineraries
    cnt = 0
    for g in groups:
        if len(groups[g]) <= 2:
            cnt += 1
        else:
            # greedily put adjacent events on the same group
            nextgroup = groups[g][0]
            for i in range(1, len(groups[g])):
                if groups[g][i - 1] == nextgroup:
                    nextgroup = groups[g][i]
                else:
                    break
            cnt += 1

    return str(cnt)

